const sec3 = ()=>{
    return(
        <div className="sec3">
            <p>
                <span>9,624,184</span>명의 회원이 쏘카와 <br/>
                함께하고 있습니다. <br/>
                지금 바로 <span>쏘카 드라이브</span>를 <br/>
                시작하세요.
            </p>
            <div></div>
        </div>
    )
}
export default sec3;
